import { NavLink } from 'react-router-dom';

const linkStyles = {
	display: 'inline-block',
	width: '50px',
	padding: '12px',
	margin: '0 6px 6px',
	background: 'blue',
	textDecoration: 'none',
	color: 'white',
};
const NavBar = () => {
	return (
		<div>
			<NavLink to="/home" exact></NavLink>
		</div>
	);
};

export default NavBar;
